import React from 'react';
import './awards.css'

const Awards = () => {
    return (
        <>
            <section className='container'>
                <h2>Награды</h2>
                <p>Уровень нашего дизайна признан меддународными эксперами</p>

            </section>

        </>
    );
};

export default Awards;
